                <p className = "info-header-styling textSelect">Pasterino , Cluj-Napoca's italian delight!</p>
            </div>
            <div className = "info-center-items">
                <p className = "info-p-styling textSelect">We are delighted that our doors are now open.</p>
                <p className = "info-p-styling info-p-indent">Working with the freshest ingredients, imported pasta, and top quality cuts of meat, Pasterino. owes a great deal of its successful menu to its purveyors such as Middendorf Meats, Joe Fazio’s Bakery, DiMare’s Specialty Foods, Louisa Foods, Allen Foods, Paramount Liquor, Grey Eagle Distributors, Lohr Distributors, and Coca-Cola.</p>
                <p className = "info-p-styling info-p-indent">In an effort to provide dining patrons with new tastes in Italian cuisine, The Pasta House Co. works on an ongoing basis to improve existing dishes and to develop new menu items that appeal to today’s increasing number of consumers who insist on consistently high-quality, good tasting Italian fare with authentic “old country” flavor.</p>
                <p className = "info-p-styling -mt-52">xxxxxxx</p>
            </div>
        </div>
    );
}

export default Info;
